import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { getLostItems } from '../store/slice/lostItemReducer';

function Home() {

    const {lostItems} = useSelector(state=>state.lostItemReducer);
    const dispatch = useDispatch();

    useEffect(()=>{
        dispatch(getLostItems());
        console.log(lostItems);
    }, [lostItems])

    return (
        <div>
            Hello world
        </div>
    )
}

export default Home;
